import React, { Component } from "react";

class Nav extends Component {
  render() {
    return (
      <nav className="navbar bg-light">
      <div className="container-fluid">
        <a className="navbar-brand" href={this.props.url}>Navbar</a>
      </div>
    </nav>

    );
  }
}

export default Nav;
